INSERT INTO `administrador_publicacion` VALUES (1,1,'publicaciones/unnamed_9SjMxwa.jpg','Resultados del examen de admisión nuevo ingreso','El Instituto Tecnológico les da la mas cordial bienvenida a los jóvenes aceptados una vez hecha la selección y da a conocer los resultados del examen ','<p>El Instituto Tecnol&oacute;gico les da la mas cordial bienvenida a los j&oacute;venes aceptados una vez hecha la selecci&oacute;n y da a conocer los resultados del examen de admisi&oacute;n CENEVAL a nuevo ingreso, a Licenciaturas para el periodo enero - junio de 2015.</p>\r\n\r\n<p>Pueden consultar las listas en los archivos vinculados a continuaci&oacute;n.</p>\r\n\r\n<p>Nota: Estar al pendiente en los primeros d&iacute;as del mes de enero donde se publicar&aacute;n los requisitos y costos, fechas de inscripci&oacute;n e inicio a clases.</p>\r\n','2014-12-19','2014-12-19 19:59:11','2015-01-20 06:00:00',1,1,1),(4,1,'publicaciones/Valhalla_crater_on_Callisto_MlFnXZu.jpg','Calisto','Calisto es un satélite del planeta Júpiter, descubierto en 1610 por Galileo Galilei. Es el tercer satélite más grande del Sistema Solar','<p>Calisto&nbsp;es un sat&eacute;lite del planeta J&uacute;piter, descubierto en 1610 por Galileo Galilei.1 Es el tercer sat&eacute;lite m&aacute;s grande del Sistema Solar y el segundo del sistema joviano, despu&eacute;s de Gan&iacute;medes. Calisto tiene aproximadamente el 99% del di&aacute;metro del planeta Mercurio, pero solo un tercio de su masa. Es el cuarto sat&eacute;lite galileano en cuanto a distancia a J&uacute;piter, con un radio orbital de 1 880 000 kil&oacute;metros.2 No est&aacute; influido por la resonancia orbital que afecta a los tres sat&eacute;lites galileanos interiores &mdash;&Iacute;o, Europa y Gan&iacute;medes&mdash;, por lo que no sufre un calentamiento apreciable por fuerzas de marea, como s&iacute; ocurre en los otros tres.8 Calisto tiene una rotaci&oacute;n s&iacute;ncrona, es decir, su per&iacute;odo de rotaci&oacute;n concuerda con su per&iacute;odo orbital, de manera que, igual que la Luna con la Tierra, siempre &laquo;muestra&raquo; la misma cara a J&uacute;piter. La superficie de Calisto no est&aacute; tan influida por la magnetosfera de J&uacute;piter como la de los otros sat&eacute;lites interiores ya que su &oacute;rbita es m&aacute;s lejana.9</p>\r\n\r\n<p>Este sat&eacute;lite est&aacute; compuesto aproximadamente por partes iguales de roca y hielo, con una densidad media de unos 1,83 g/cm3. Los componentes detectados mediante la firma espectral de la superficie incluyen hielo, di&oacute;xido de carbono, silicatos y compuestos org&aacute;nicos. La investigaci&oacute;n de la sonda espacial Galileo revel&oacute; que Calisto tiene un n&uacute;cleo, compuesto principalmente de silicatos, y adem&aacute;s, la posibilidad de la existencia de un oc&eacute;ano interno de agua l&iacute;quida a una profundidad superior a 100 kil&oacute;metros.10 11</p>\r\n\r\n<p>La superficie de Calisto est&aacute; repleta de cr&aacute;teres y es muy antigua. No presenta se&ntilde;ales de actividad tect&oacute;nica y se piensa que su evoluci&oacute;n se ha producido predominantemente bajo la influencia de los impactos de numerosos meteoritos a lo largo de su existencia.12 Los principales accidentes geogr&aacute;ficos incluyen m&uacute;ltiples estructuras, como cr&aacute;teres de impacto, grandes cuencas de impacto con m&uacute;ltiples anillos conc&eacute;ntricos (con los escarpes, crestas y dep&oacute;sitos a ellas asociadas) y cadenas de cr&aacute;teres (catenae).12 A peque&ntilde;a escala, la superficie es variada y consiste en peque&ntilde;os y brillantes dep&oacute;sitos congelados en las cimas de las alturas, rodeadas por un litoral bajo, compuesto de material oscuro.5 La edad absoluta de los accidentes geogr&aacute;ficos se desconoce.</p>\r\n\r\n<p>Calisto est&aacute; rodeado por una atm&oacute;sfera extremadamente fina, compuesta de di&oacute;xido de carbono y probablemente de ox&iacute;geno molecular,6 7 adem&aacute;s de una ionosfera relativamente fuerte.13 Se piensa que el segundo sat&eacute;lite mayor de J&uacute;piter se form&oacute; por una &laquo;lenta&raquo; acreci&oacute;n del remolino de materia que rode&oacute; J&uacute;piter despu&eacute;s de su formaci&oacute;n.14 Esta lentitud y la falta de fuerzas de marea evitaron una r&aacute;pida diferenciaci&oacute;n qu&iacute;mica. La tambi&eacute;n lenta convecci&oacute;n en el interior de Calisto, que empez&oacute; poco despu&eacute;s de su formaci&oacute;n, ha producido una diferenciaci&oacute;n qu&iacute;mica parcial y aporta la posibilidad de un oc&eacute;ano interior a una profundidad de 100 a 150 kil&oacute;metros, as&iacute; como un peque&ntilde;o n&uacute;cleo rocoso.15</p>\r\n\r\n<p>La probable presencia de un oc&eacute;ano l&iacute;quido bajo la superficie de Calisto indica que puede o podr&iacute;a haber albergado vida.16 Sin embargo, esto es menos probable que en Europa.17 Diversas sondas espaciales como la Pioneer 10 y 11 o la Galileo y la Cassini han estudiado el sat&eacute;lite. Calisto est&aacute; considerado el lugar m&aacute;s &laquo;acogedor&raquo; para una base humana en una futura exploraci&oacute;n del sistema joviano.18</p>\r\n','2014-12-18','2014-12-02 19:59:11',NULL,0,1,1),(5,1,'publicaciones/_DSC0174.JPG','Feliz Navidad y próspero año 2015','Mensaje del Ing. Eliot Joffre Vázquez, Director del Instituto Tecnológico de Acapulco.','<p><strong>MENSAJE DEL ING. ELIOT JOFFRE V</strong><strong>&Aacute;</strong><strong>ZQUEZ</strong></p>\r\n\r\n<p>Me es muy grato dirigirme a los Alumnos, Docentes y Personal de Apoyo y Asistencia a la Educaci&oacute;n, para manifestarles el reconocimiento a su labor, siendo propicio por las fechas navide&ntilde;as y por el a&ntilde;o que culmina y por uno m&aacute;s que inicia.</p>\r\n\r\n<p>Son momentos para reflexionar en lo que hemos hecho, los logros obtenidos y tambi&eacute;n en lo que nos falta por hacer para lograr las metas que nos hemos fijado en nuestro Programa de Trabajo Anual y en el Programa Institucional de Innovaci&oacute;n y Desarrollo 2014 &ndash; 2018,</p>\r\n\r\n<p>El a&ntilde;o 2014 ha sido un a&ntilde;o de ajustes sociales y pol&iacute;ticos tanto en lo externo como en la cara interna de nuestra Instituci&oacute;n. Sufrimos embates sociales de muy alto impacto pol&iacute;tico en sus diversas manifestaciones, de luchas sociales, reclamos por las injusticias sufridas a grupos vulnerables, luchas estudiantiles, luchas de grupos civiles y m&uacute;ltiples reclamos a los gobernantes de nuestro Municipio, nuestro Estado y nuestro Pa&iacute;s por el flagelo de la inseguridad y la corrupci&oacute;n.</p>\r\n\r\n<p>Vivimos un cambio con la&nbsp; creaci&oacute;n del&nbsp; Tecnol&oacute;gico&nbsp; Nacional de M&eacute;xico, en la Direcci&oacute;n de Nuestra Instituci&oacute;n a partir del mes de mayo, tambi&eacute;n se renov&oacute; el Cuadro de nuestra Delegaci&oacute;n Sindical en el mes de octubre y la renovaci&oacute;n del Consejo Ejecutivo de la Sociedad de Alumnos en el mes de diciembre, y con ello se renuevan estrategias y se establece una visi&oacute;n de unidad para el avance de nuestra Instituci&oacute;n.</p>\r\n\r\n<p>Ante los embates del exterior, nuestra fortaleza es la unidad, el trabajo organizado, el cumplimiento de metas en nuestra tarea sustantiva que es el proceso educativo en favor de nuestros estudiantes.</p>\r\n\r\n<p>Sirva este marco para desearles que en sus hogares reine la armon&iacute;a, la paz, el amor familiar y en su &aacute;mbito laboral y social una gran fraternidad. Que juntos superemos los momentos dif&iacute;ciles y que juntos celebremos los logros alcanzados. Que la Navidad sea un c&uacute;mulo de momentos felices en compa&ntilde;&iacute;a de sus seres queridos. Que la celebraci&oacute;nn del a&ntilde;o nuevo sea motivo de la reflexi&oacute;n del a&ntilde;o 2014 que se va y de esperanza por el a&ntilde;o 2015 que inicia.</p>\r\n\r\n<p>Reciban un cordial saludo de nuestro Director General el Maestro Manuel Quintero Quintero y en mi nombre, un abrazo fraterno del cuerpo directivo con el honor de formar parte esta familia Tecnol&oacute;gica.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Diciembre de 2014</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Atentamente</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ing. Eliot Joffre V&aacute;zquez</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Director</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></p>\r\n','2014-12-19','2014-12-19 19:59:11','2015-01-07 18:00:00',1,2,2),(6,1,'publicaciones/placeholder_7QpODFp.jpg','Revisión de retícula','Se informa que el proceso de revisión de retícula se llevará a cabo a partir de la semana del 08 de diciembre de 2014, para las carreras de Arquitectu','<p>Se informa que el proceso de revisi&oacute;n de ret&iacute;cula se llevar&aacute; a cabo a partir de la semana del 08 de diciembre de&nbsp;2014, para las carreras de Arquitectura, Ingenier&iacute;a Electromec&aacute;nica, Ingenier&iacute;a Bioqu&iacute;mica, Ingenier&iacute;a en Sistemas Computacionales y Licenciatura en Administraci&oacute;n.</p>\r\n\r\n<p>A partir del lunes 08 de Diciembre del presente a&ntilde;o se llevar&aacute; a cabo la revisi&oacute;n de ret&iacute;cula de cuerdo al orden&nbsp;programado de los n&uacute;meros de control (inicio de los n&uacute;meros de control) en la siguiente tabla</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>ESPECIALIDAD</td>\r\n			<td>Lunes<br />\r\n			08 Dic<br />\r\n			11:00 &ndash; 14:00</td>\r\n			<td>Martes<br />\r\n			09 Dic<br />\r\n			12:00 &ndash; 15:00</td>\r\n			<td>Mi&eacute;rcoles<br />\r\n			10 Dic<br />\r\n			11:00 &ndash; 14:00</td>\r\n			<td>Jueves<br />\r\n			11 Dic<br />\r\n			11:00 &ndash; 14:00</td>\r\n			<td>Viernes<br />\r\n			12 Dic<br />\r\n			11:00 &ndash; 14:00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>ARQUITECTURA</td>\r\n			<td>08 y 09</td>\r\n			<td>10</td>\r\n			<td>11</td>\r\n			<td>12</td>\r\n			<td>13, 14</td>\r\n		</tr>\r\n		<tr>\r\n			<td>ELECTROMEC&Aacute;NICA</td>\r\n			<td>10</td>\r\n			<td>08, 09, 14</td>\r\n			<td>11</td>\r\n			<td>12</td>\r\n			<td>13, 14</td>\r\n		</tr>\r\n		<tr>\r\n			<td>SISTEMAS COMPUTACIONALES</td>\r\n			<td>08, 09, 14</td>\r\n			<td>10</td>\r\n			<td>11</td>\r\n			<td>12</td>\r\n			<td>13</td>\r\n		</tr>\r\n		<tr>\r\n			<td>ADMINISTRACION</td>\r\n			<td>07, 08, 09</td>\r\n			<td>10</td>\r\n			<td>11</td>\r\n			<td>12</td>\r\n			<td>13</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<ul>\r\n	<li>Presentarse con credencial vigente.</li>\r\n	<li>La revisi&oacute;n la debe llevar a cabo &uacute;nicamente el interesado.</li>\r\n</ul>\r\n\r\n<p>Posteriormente se programar&aacute;n las carreras restantes.</p>\r\n\r\n<p>Atentamente Departamento de Servicios Escolares.</p>\r\n','2014-12-08','2014-12-08 16:01:37',NULL,0,1,1),(7,1,'publicaciones/placeholder_qhzxgS2.jpg','Convocatoria servicio social','A los alumnos que estén interesados en condiciones de presentar su servicio social y a las instituciones publicas que lo requieran','<p>A los alumnos que est&eacute;n interesados en condiciones de presentar su servicio social y a las instituciones publicas que requieran prestadores de servicio social.</p>\r\n','2014-12-11','2014-12-11 16:01:37',NULL,0,1,1),(8,1,'publicaciones/curso-ingles-gratis.jpg','Convocatoria curso de ingles','La División de Estudios Profesionales oferta los cursos de inglés de los siguientes niveles: Cursos de inglés intensivo 2014 Nivel III, Nivel IV ','<p>La Divisi&oacute;n de Estudios Profesionales oferta los cursos de ingl&eacute;s<br />\r\nde los siguientes niveles:</p>\r\n\r\n<p><br />\r\nCursos de ingl&eacute;s intensivo 2014<br />\r\nNivel III<br />\r\nNivel IV</p>\r\n\r\n<p><br />\r\nDel 18 de Noviembre al 15 de Diciembre de 2014<br />\r\nLunes a viernes de las 15:00 a las 18:00 horas</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Secuencia de etapas</td>\r\n			<td>Actividad</td>\r\n			<td>Responsable</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Pago y canje</td>\r\n			<td>Realiza el pago en el banco y el canje en el Depto. de Recursos financieros. 07 al 12 de noviembre del 2014</td>\r\n			<td>estudiante</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Registro del curso</td>\r\n			<td>Entrega recibo de pago&nbsp;original y copia y se&nbsp;registra en el nivel del&nbsp;grupo en la Divisi&oacute;n&nbsp;de Estudios&nbsp;Profesionales. Del 7&nbsp;al 12 de Noviembre en&nbsp;el horario de las 9:00&nbsp;a las 14:00 horas.</td>\r\n			<td>estudiante</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>NOTA:</p>\r\n\r\n<ul>\r\n	<li>La generaci&oacute;n de cursos a ofertar est&aacute; sujeto a la capacidad l&iacute;mite&nbsp;de 15 a 25 estudiantes.</li>\r\n	<li>Los cursos de los niveles tendr&aacute;n un costo de $500.00.</li>\r\n	<li>Depositar en el banco Banorte, No. de empresa 37333, Referencia&nbsp;bancaria E003CRINGLES2.</li>\r\n	<li>A partir de esta convocatoria ya no se ofertar&aacute; el nivel I y II</li>\r\n	<li>Los cursos de niveles III y IV de manera paulatina entrar&aacute;n en&nbsp;proceso de liquidaci&oacute;n.</li>\r\n	<li>Los ex&aacute;menes globales de ingl&eacute;s se continuar&aacute;n aplicando el &uacute;ltimo&nbsp;viernes de cada mes previa convocatoria.</li>\r\n</ul>\r\n','2014-11-11','2014-12-11 16:01:37',NULL,0,1,1),(9,1,'publicaciones/DSC_8242.JPG','Convocatorias FESE','Convocatorias disponibles por parte de la FESE','<p>Mujeres emprendiendo, <a href=\"http://www.it-acapulco.edu.mx/descargas/gtv_mujeresemprendiendo.pdf\" target=\"_blank\">click aqu&iacute;</a>.</p>\r\n\r\n<p>Certamen emprendedores, <a href=\"http://www.it-acapulco.edu.mx/descargas/gtv_certamenemprendedores.pdf\" target=\"_blank\">click aqu&iacute;</a>.</p>\r\n\r\n<p>Emprendimiento agroindustrial, <a href=\"http://www.it-acapulco.edu.mx/descargas/gtv_emprendimientoagroindustrial.pdf\" target=\"_blank\">click aqu&iacute;</a>.</p>\r\n\r\n<p>Atentamente Departamento de Gesti&oacute;n Tecnol&oacute;gica y Vinculaci&oacute;n.</p>\r\n','2015-01-15','2015-01-15 17:32:01','2015-01-16 18:00:00',1,2,2),(10,1,'publicaciones/_DSC9859.JPG','Entrega de capítulo 5000','El Ing Eliot Joffre Vázquez, entrega capítulo 5000 a los departamentos solicitantes.','<p>El Ing. Eiot Joffre V&aacute;zquez entrega cap&iacute;tulo 5000 a los departamentos de Ciencias de la Tierra, Econ&oacute;mico Administrativas e Ingenier&iacute;a en Sistemas Computacionales.</p>\r\n\r\n<p>Entre equipo de c&oacute;mputo y mobiliario, viene a reforzar el trabajo de oficina y de laboratorios, talleres y &aacute;reas acad&eacute;micas para el mejor aprovechamiento de los alumnos en cuanto a conocimiento por las pr&aacute;cticas efectuadas.</p>\r\n','2015-01-15','2015-01-15 17:32:01','2015-01-19 18:00:00',1,2,6),(12,1,'publicaciones/DSCN2508.JPG','Credencial alumnos de nuevo ingreso','Información importante para alumnos de nuevo ingreso para la obtención de su credencial escolar','<p>A los alumnos de nuevo ingreso se les informa que deber&aacute;n asistir al Departamento de Servicios Escolares el martes 03 de Febrero de 2015 para tomarse la fotograf&iacute;a para la elaboraci&oacute;n de su credencial. Atentamente Departamento de Servicios Escolares.</p>\r\n','2015-02-02','2015-02-02 09:05:13','2015-02-07 18:00:00',1,1,2),(13,1,'publicaciones/DSC_6898.JPG','Convocatoria para nuevo ingreso','Se abre la convocatoria para alumnos de nuevo ingreso que hayan culminado sus estudios de nivel medio superior para el ciclo febrero a junio de 2015','<p><span style=\"font-size:14px\"><u><em><strong>Convocatoria de nuevo ingreso:</strong></em></u></span></p>\r\n\r\n<p>Para alumnos que hayan culminado sus estudios de educaci&oacute;n media superior y que deseen estudiar una licenciatura en las siguientes carreras:</p>\r\n\r\n<p>Arquitectura</p>\r\n\r\n<p>Ingenier&iacute;a Bioqu&iacute;mica</p>\r\n\r\n<p>Ingenier&iacute;a en Sistemas computacionales</p>\r\n\r\n<p>Ingenier&iacute;a Electromec&aacute;nica</p>\r\n\r\n<p>Ingenier&iacute;a en Gesti&oacute;n Empresarial</p>\r\n\r\n<p>Licenciaturas en Administraci&oacute;n y Contuadur&iacute;a.</p>\r\n\r\n<p>Ver enlaces de convocatoria, gu&iacute;a del examen de admisi&oacute;n y procedimiento para obtener su ficha.</p>\r\n','2015-02-04','2015-02-04 18:00:00','2015-02-25 18:00:00',1,2,2),(14,1,'publicaciones/olegario.jpg','Reconocimiento al Ing. Olegario Orozco Antonio','Reconocido por su trayectoria, el día 9 de febrero del 2015, en el marco de la Ceremonia de Inicio de Cursos Enero-Junio 2015 a las 9;00 hrs.','<h1><em><span style=\"font-size:18px\"><strong>SEMBLANZA: ING. OLEGARIO OROZCO ANTONIO</strong></span></em></h1>\r\n\r\n<p>&iexcl;&iexcl;&iexcl;En todos mis cargos y desempe&ntilde;os he disfrutado mi trabajo, dejando &rdquo;huellas en la arena, que no borra el viento&rdquo;!!!</p>\r\n\r\n<p>Ing. Olegario Orozco Antonio</p>\r\n\r\n<p>Con su rostro sereno y una personalidad seria que lo ha distinguido durante sus 50 a&ntilde;os de servicios en la docencia, evoca sus inicios en el Instituto Tecnol&oacute;gico de Acapulco y comparte con nosotros su trayectoria profesional.</p>\r\n\r\n<p>El Ing. Olegario Orozco Antonio es originario de Santiago Laollaga Tehuantepec, Oax. Proveniente de una familia de grandes tradiciones, quienes transmitieron en &eacute;l, valores que han influido en su formaci&oacute;n como un hombre disciplinado y respetuoso.</p>\r\n\r\n<p><strong>PREPARACI&Oacute;N ACAD&Eacute;MICA</strong></p>\r\n\r\n<p>Sus estudios de primaria y secundaria los realiz&oacute; en internados; la primera en Oaxaca, Oax., y la segunda en Orizaba, Ver., en nivel medio superior adquiri&oacute; el grado de T&eacute;cnico Electricista, sigui&oacute; con su preparaci&oacute;n profesional en el &aacute;rea de Ingenier&iacute;a Industrial, egresado del Instituto Tecnol&oacute;gico No. 16 de Oaxaca, Oax., posteriormente hizo sus estudios de posgrado, obteniendo el grado de Maestro en Administraci&oacute;n Educativa.</p>\r\n\r\n<p><strong>50 A&Ntilde;OS DE SERVICIOS EN LA EDUCACI&Oacute;N</strong></p>\r\n\r\n<p>Con una franca sonrisa, recuerda el a&ntilde;o de 1964, como una de las &eacute;pocas que marc&oacute; su gran vocaci&oacute;n; servir a la educaci&oacute;n.</p>\r\n\r\n<p>Se inici&oacute; en el Sistema Nacional de Educaci&oacute;n T&eacute;cnica como titular del Taller de Electricidad en el Centro de Capacitaci&oacute;n para el Trabajo Industrial, en la ciudad de Aguascalientes, Ags., despu&eacute;s, en 1965 se incorpora como subdirector encargado, de la Escuela Secundaria T&eacute;cnica Industrial No. 14 de Oaxaca, Oax., cargo que desempe&ntilde;&oacute; hasta 1973, en ese mismo a&ntilde;o, se crea la Escuela Secundaria T&eacute;cnica No.10 en Juchit&aacute;n, Oax., teniendo la fortuna de ser el Director fundador, cargo que ocup&oacute; hasta junio de 1976.</p>\r\n\r\n<p><strong>INSTITUTO TECNOL&Oacute;GICO DE ACAPULCO, SU GRAN EXPERIENCIA</strong></p>\r\n\r\n<p>En agosto de 1976 a un a&ntilde;o de haberse fundado el Instituto Tecnol&oacute;gico de Acapulco, se incorpora con el nombramiento de subdirector, cargo que renuncia en 1983 para ocuparse del montaje e instalaciones del Laboratorio de Ingenier&iacute;a Electromec&aacute;nica, posteriormente se desempa&ntilde;a como Jefe de laboratorio por t&eacute;rmino de tres a&ntilde;os y cinco meses.</p>\r\n\r\n<p>Desde su ingreso al ITA, hasta la actualidad ha impartido c&aacute;tedra en las asignaturas de Conversi&oacute;n de la energ&iacute;a I; Electricidad y magnetismo; Metrolog&iacute;a El&eacute;ctrica, Mediciones El&eacute;ctricas; Controles de Motores El&eacute;ctricos; Metrolog&iacute;a y Normalizaci&oacute;n e Investigaci&oacute;n I.</p>\r\n\r\n<p><strong>CARGOS HONOR&Iacute;FICOS DENTRO DEL I.T.A.</strong></p>\r\n\r\n<p>En los inicios del I. T. de Acapulco, se cre&oacute; un patronato en el que ocup&oacute; durante cuatro a&ntilde;os el cargo de Presidente, al paso de los a&ntilde;os dentro del Instituto, ha venido desempe&ntilde;ando cargos y a la vez distinciones de los que se ha hecho merecedor por su gran sentido de responsabilidad y excelente desempe&ntilde;o acad&eacute;mico ya que ha sido nombrado y ratificado siete veces &ldquo;Presidente de la Comisi&oacute;n Dictaminadora Docente&rdquo;. Asimismo, por sus a&ntilde;os de servicios a la educaci&oacute;n ha sido obsequiado con las medallas: Rafael Ram&iacute;rez e Ignacio Altamirano.</p>\r\n\r\n<p>El Ing. Olegario, est&aacute; satisfecho de su trayectoria y del crecimiento del Instituto. En sus momentos, ha sido dispensado con el favor, respeto y consideraciones de sus colaboradores y de sus jefes, al igual que hoy con sus compa&ntilde;eros y alumnos.</p>\r\n\r\n<p>Por sus a&ntilde;os de servicios en la docencia, opina que ha observado el desarrollo de la Educaci&oacute;n t&eacute;cnica en M&eacute;xico. Percibe que en los inicios hab&iacute;a m&aacute;s competencia y compromiso, tanto en el docente como del estudiante, a pesar de los cambios cient&iacute;ficos y tecnol&oacute;gicos que se han suscitado.</p>\r\n\r\n<p>Por lo que ata&ntilde;e al I.T.A. considera que es una Instituci&oacute;n gloriosa en M&eacute;xico, Guerrero y Acapulco.</p>\r\n\r\n<p>&iexcl;&iexcl;&iexcl;Puntualizando que... a pesar de la experiencia se sigue aprendiendo!!!</p>\r\n','2015-02-07','2015-02-07 04:34:30','2015-02-28 18:00:00',1,NULL,2);
